window.bookSummaryJSON = "<p>It takes everything.</p> <p>Andien Broxin has what she wanted: an opportunity to prove her worth through the rigorous and sometimes lethal Legion Selection.</p> <p>The daughter of a legionnaire, she knows what to expect. Legion Selection will test every fiber of her being, heaping on endless trials of pressure, stress, and pain. Most candidates quickly find their breaking points, while others are merely broken.</p> <p>Only a precious few, the one percent of the one percent of the one percent, will earn their armor and become...legionnaires. </p> <p>Don’t miss the long-awaited sequel to the Associated Press best-selling audiobook <i>Forget Nothing</i> by Dragon Award winner Jason Anspach and USMC and Army veteran Michelle C. Meyers! </p>"; 
